window.bookSummaryJSON = "<p><b>Series complete! Get the first three books here!</b></p> <p>Dragged through a portal to a fantasy land brimming with monsters, Connor has to hit the ground running just to survive. Worse, he has to get settlement-building to defend himself against 99 other lords, all of whom are out for his blood!</p> <p><i>Warlords of the Circle Sea</i> is a LitRPG town-building adventure packed full of monster battles, shady elves, an unhelpful wiki called Borg, and a smoking-hot goddess named Xandaphrey.</p> <p>But Connor is not alone. Others have been dragged from Earth. He must enlist them to help him build an empire, or else he will fail. If he does, only death awaits.&nbsp;</p> <p>Follow Connor as he builds his team, his town, and his new country of Devon. He expected to die when the car smashed into him; now he’s been reincarnated in a new land, plunged butt-naked into a strange 4X game-world with only 30 days to build a strong and defensible kingdom, and with only one advantage - he has his gamer instincts. Will that be enough, or will he need some luck?</p> <p>Finding himself at the bottom of the leaderboard, he’ll need to complete dangerous side quests to catch up if he’s to have any hope of winning the contest. Can Connor and his crew battle their way to victory?&nbsp;</p> <p><i>Warlords of the Circle Sea Box Set</i> includes books one through three. That’s <i>Dragon’s Mist</i>, <i>Dragon’s Born</i>, and <i>Dragon’s Realm</i> and a huge listen. Pick up <i>Dragon’s Knight </i>and <i>Dragon’s End</i>, and you’ve got the whole story!&nbsp;</p> <p>If you like empire-building, action-packed sequences, detailed progression stats, and fantasy worlds, then you’ll love Ember Lane’s merciless countdown. Buy <i>Warlords of the Circle Sea Box Set</i> to plug in and conquer today!&nbsp;</p> <p>Warlords of the Circle Sea is a LitRPG adventure fantasy packed full of monster hunting and town building. Plenty of cussing. No harem. Yeah, big weapons and stats abound!</p>"; 
